import React from "react";
import { Link } from "react-router-dom";

import { ReactComponet as Logo } from "../../assets/logo.svg";
import "./header.styles.css";

const Header = () => (
  <div className="header">
    <Link className="logo-container" path="/">
      <Logo className="logo" />
    </Link>
    <div className="options">
      <Link className="option" to="/shop">
        SHOP
      </Link>
      <Link className="option" to="/shop">
        CONTACT
      </Link>
      <div className="option" onClick={() => console.log("sign in clicked")}>
        SIGN OUT
      </div>
      <Link className="option" to="/signin">
        SIGN IN
      </Link>
    </div>
  </div>
);
export default Header;
